import React from 'react';
import {
  MDBFooter,
  MDBContainer,
} from 'mdb-react-ui-kit';
import { Nav } from 'react-bootstrap';
import { FaWhatsapp, FaInstagram, FaSnapchat, FaTwitter, FaFacebook, FaEnvelope } from 'react-icons/fa';

export default function Footer() {
  return (
    <MDBFooter className='bg-light text-center text-white'>
      <MDBContainer className='p-4 pb-0'>
        <section className='mb-4'>
        <Nav className="me-auto">
        <Nav.Link href="#"><FaWhatsapp /></Nav.Link>
        <Nav.Link href="#"><FaInstagram /></Nav.Link>
        <Nav.Link href="#"><FaSnapchat /></Nav.Link>
        <Nav.Link href="#"><FaTwitter /></Nav.Link>
        <Nav.Link href="#"><FaFacebook /></Nav.Link>
        <Nav.Link href="#"><FaEnvelope /></Nav.Link>
      </Nav>
        </section>
      </MDBContainer>

      <div className='text-center p-3' style={{ backgroundColor: 'rgba(0, 0, 0, 0.2)' }}>
        © 2020 Copyright:
        <a className='text-white' href='https://أكاديمية نور القرءان.com/'>
          أكاديمية نور القرءان
        </a>
      </div>
    </MDBFooter>
  );
}
